export default function CtaSection() {
  return (
    <section className="ll-section ll-cta-section">
      <div className="ll-container">
        <div className="ll-cta-inner">
          <p className="ll-section-label" style={{ color: "var(--accent)" }}>Free HR Bot Consultation</p>
          <h2>Launch Your Onboarding &<br />Policy ExplainerBot</h2>
          <p>Book a focused consultation to map your HR documents, onboarding flow, and rollout plan for a reliable employee support assistant.</p>
          <a href="#" className="ll-btn-primary">Book Your Free Consultation</a>
        </div>
      </div>
    </section>
  );
}
